import React from "react";
import "./FoodNav.css";

function FoodNav() {
  return (
    <div>
      <nav>
        <div>
          <img src=".../img/hero-bg.svg" alt="lilies icon" />
          <h2>Lillies</h2>
        </div>
        <div>
          <a href="www.google.com">Home</a>
          <a href="www.google.com">Login</a>
          <a href="www.google.com">Signup</a>
        </div>
      </nav>
    </div>
  );
}
export default FoodNav;
